piranha.navigation=piranha.navigation||{},piranha.navigation.permissions={loaded:!1,menus:{editItems:!1,deleteItems:!1},load:function(){return this.loaded?Promise.resolve():fetch(piranha.baseUrl+"manager/api/navigation/permissions").then(e=>e.json()).then(e=>(this.menus.editItems=e.editItems,this.menus.deleteItems=e.deleteItems,this.loaded=!0,e)).catch(function(e){console.log("error:",e)})}};